(window.webpackJsonp=window.webpackJsonp||[]).push([[66],{630:function(n){n.exports={name:"about",displayName:"关于 Nami",text:"\n> **警告：**\n>\n> -   该项目仍处于早期开发阶段，因此仍缺失一些关键组件及功能，且其更新策略较为激进，会有大量破坏性更新；\n> -   使用 CSS 变量等较新特性，浏览器兼容性较差；\n> -   只兼容 React 16 及以上版本；\n\nNami 是一个基于 React 开发的桌面端组件库；源于作者对前端技术和交互设计的学习与探索，以及个人使用上的需要。\n\n## 兼容性\n\n-   `Chrome` 49+\n-   `Firefox` 42+\n-   `Safari` 9.1\n-   `Opera` 36+\n-   `Edge` 16+\n-   `IE` _no support_\n",path:"./docs/about.md"}}}]);